import './containerData.css'

function ContainerData(weatherCity){

    const temp = weatherCity.main.temp
    console.log(temp)

    return(

        <div className='containerData'>

            <div className='date'>

                <span>Ola</span>

            </div>

            <div className='date'>

                <span>Temperatura</span>
                <span>{temp}</span>

            </div>

            <div className='date'>

                <span>Ola</span>

            </div>
          

        </div>

    );

}

export default ContainerData;
